import React, { Component } from 'react';

class PersonalInfoForm extends Component {
    render() {
        return (
            <div>
        <h3>Enter Personal Info!</h3>
        <Form onSubmit={(e) => this.handleSubmit(e)}>
          <Form.Group widths="equal">
            <Form.Input fluid label="name" placeholder="Name" name="name" />
            <Form.Input fluid label="email" placeholder="Email" name="email" />
            <Form.Input fluid label="phone" placeholder="Phone" name="phone" />
            <Form.Input fluid label="bio" placeholder="Bio" name="bio" />
            <Form.Input fluid label="title" placeholder="Title" name="title" />
          </Form.Group>
          <Form.Button>Submit</Form.Button>
        </Form>
            </div>
        );
    }
}

export default PersonalInfoForm;
